import React, { useState } from "react";
import "./Diet.css";

const DietForm = ({ formData, handleChange, handleSubmit, loading }) => {
  const primaryPurposes = ["Lose Weight", "Gain Muscle", "Maintain Weight"];
  const dietPreferences = ["Vegetarian", "Vegan", "Keto", "Paleo", "Omnivore"];

  const [useMetric, setUseMetric] = useState(true);

  const handleUnitChange = (event) => {
    setUseMetric(event.target.value === "metric");
    handleChange({
      target: {
        name: "unit",
        value: event.target.value,
      },
    });
  };

  const handleInputChange = (event) => {
    const { name, value } = event.target;
    handleChange({
      target: {
        name,
        value,
      },
    });
  };

  return (
    <form onSubmit={handleSubmit} className="form-container">
      <div className="form-group">
        <label>Gender:</label>
        <select
          name="gender"
          value={formData.gender}
          onChange={handleInputChange}
        >
          <option value="Male">Male</option>
          <option value="Female">Female</option>
        </select>
      </div>
      <div className="form-group">
        <label>Units:</label>
        <select value={formData.unit} onChange={handleUnitChange}>
          <option value="metric">Metric (cm, kg)</option>
          <option value="imperial">Imperial (ft/in, lbs)</option>
        </select>
      </div>
      {useMetric ? (
        <>
          <div className="form-group">
            <label>Height (cm):</label>
            <input
              type="number"
              name="height"
              value={formData.height}
              onChange={handleInputChange}
            />
          </div>
          <div className="form-group">
            <label>Weight (kg):</label>
            <input
              type="number"
              name="weight"
              value={formData.weight}
              onChange={handleInputChange}
            />
          </div>
        </>
      ) : (
        <>
          <div className="form-group">
            <label>Height:</label>
            <input
              type="number"
              name="heightFeet"
              placeholder="Feet"
              value={formData.heightFeet || ""}
              onChange={handleInputChange}
              style={{ marginRight: "10px", width: "calc(50% - 5px)" }}
            />
            <input
              type="number"
              name="heightInches"
              placeholder="Inches"
              value={formData.heightInches || ""}
              onChange={handleInputChange}
              style={{ width: "calc(50% - 5px)" }}
            />
          </div>
          <div className="form-group">
            <label>Weight (lbs):</label>
            <input
              type="number"
              name="weightPounds"
              value={formData.weightPounds || ""}
              onChange={handleInputChange}
            />
          </div>
        </>
      )}
      <div className="form-group">
        <label>Primary Purpose:</label>
        <select
          name="primaryPurpose"
          value={formData.primaryPurpose}
          onChange={handleInputChange}
        >
          {primaryPurposes.map((purpose) => (
            <option key={purpose} value={purpose}>
              {purpose}
            </option>
          ))}
        </select>
      </div>
      <div className="form-group">
        <label>Meals per Day:</label>
        <input
          type="number"
          name="mealsPerDay"
          value={formData.mealsPerDay}
          onChange={handleInputChange}
        />
      </div>
      <div className="form-group">
        <label>Snacks per Day:</label>
        <input
          type="number"
          name="snacksPerDay"
          value={formData.snacksPerDay}
          onChange={handleInputChange}
        />
      </div>
      <div className="form-group">
        <label>Diet Preference:</label>
        <select
          name="dietPreference"
          value={formData.dietPreference}
          onChange={handleInputChange}
        >
          {dietPreferences.map((preference) => (
            <option key={preference} value={preference}>
              {preference}
            </option>
          ))}
        </select>
      </div>
      <div className="form-group">
        <label>Allergies:</label>
        <input
          type="text"
          name="allergies"
          value={formData.allergies}
          onChange={handleInputChange}
        />
      </div>
      <button type="submit" className="submit-button" disabled={loading}>
        {loading ? "Loading..." : "Submit"}
      </button>
    </form>
  );
};

export default DietForm;
